import React from 'react';

function ComptesPopup({ compte }) {
    const handleEdit = () => {
        alert(`Éditer le compte ID: ${compte.id}`);
    };

    const handleDelete = () => {
        alert(`Supprimer le compte ID: ${compte.id}`);
    };

    return (
        <div>
            <button onClick={handleEdit}>Éditer</button>
            <button onClick={handleDelete}>Supprimer</button>
        </div>
    );
}

export default ComptesPopup;
